import React from 'react';
import { Toolbar } from '@mui/material';
import { NavLink } from 'react-router-dom';

export default function Header() {
   return (
      <Toolbar className='main-nav'>
         <span>
            <NavLink className='main-navlink' to='/'>Home</NavLink>
         </span>
         <span>

            <NavLink className='main-navlink' to='/about'>About</NavLink>
            <NavLink className='main-navlink' to='/resorts'>Resorts</NavLink>
         </span>
      </Toolbar>
   );
}
